// import { hillData } from "../../../data/Hills";

function RouteList({ id, func, landmassRoutes }) {
    const routes = landmassRoutes.map(
        ({ name }) =>
            <option key={name} value={name}>{name}</option>
    );

    return (
        <select id={id} onChange={func}>
            {routes}
        </select>
    )
}

export default RouteList;
